import React from 'react';
import Header from './Componentes/Header';
import Corpo from './Componentes/Corpo';

function App() {
  return (
    <>
      <header>
        <Header/>
      </header>
      <main>
      <Corpo/>
      </main>
    </>
  )
}

export default App;
